import React from 'react';

const Navbar = () => {
  <nav className='navbar bg-dark'>
    <h1>
      <a href='index.html'>TelaTale</a>
    </h1>
    <ul>
      <li>
        <a href='Stories.html'>Stories</a>
      </li>
      <li>
        <a href='register.html'>Register</a>
      </li>
      <li>
        <a href='login.html'>Login</a>
      </li>
    </ul>
  </nav>;
};
export default Navbar;
